import * as React from 'react';

import DrawerLayout from '../../layout/Drawer/DrawerLayout';
import Grid from '@mui/material/Grid';



const Historial = () => {
  return (
    <>
      <DrawerLayout>
        <h1 className='title'>Historial</h1>
        <Grid container>
          <Grid xs={12}>
            <label>Armado</label>
            <label>Retiro</label>
          </Grid>

        </Grid>


      </DrawerLayout>
    </>
  )
}

export default Historial
